static const int primes_length = sizeof(primes)/sizeof(primes[0]);

static int trial_division(uint32_t p);

int is_prime(uint32_t p)
{
    int l = 0;
    int r = primes_length-1;
    int m;
    if(p%2==0)
    {
        return -1;
    }
    if(p>primes[primes_length-1])
    {
        //TODO fast primality test
        return trial_division(p);
    }
    while(l<=r)
    {
        m = (l + r) / 2;
        l = (primes[m]<p)*(m+1)+(primes[m]>p)*l;
        r = (primes[m]>p)*(m-1)+(primes[m]<p)*r;
        if(primes[m]==p)
        {
            return 0;
        }
    }
    return -1;
}

