{
    char ch = 0;
    //Flush input
    while ((ch = getchar()) != '\n' && ch != EOF)
    {
        ;
    }
    puts("Press ENTER to exit program");
    getchar();
    exit(code);
    return;
}

static int trial_division(uint32_t p)
{
    uint32_t i = 3;
    uint32_t r = (uint32_t)sqrt(p);
    while(i<=r)
    {
        if((p%i) == 0)
        {
            return -1;
        }
        i++;
    }
    return 0;
}
